import { useState } from "react";
import { ethers } from "ethers";
import RatPadABI from "./abi/RatPad.json";

const CONTRACT_ADDRESS = "0x85c1c28589f61113ba7bad763da50f3b48f4e331";

export default function App() {
  const [account, setAccount] = useState(null);
  const [contract, setContract] = useState(null);
  const [form, setForm] = useState({
    name: "",
    symbol: "",
    supply: "",
    fee: "",
    lpLock: "604800" // 1 week in seconds
  });
  const [status, setStatus] = useState("");

  const connectWallet = async () => {
    if (!window.ethereum) return alert("Please install MetaMask");
    try {
      const provider = new ethers.BrowserProvider(window.ethereum);
      const signer = await provider.getSigner();
      const address = await signer.getAddress();
      const ratPad = new ethers.Contract(CONTRACT_ADDRESS, RatPadABI, signer);
      setAccount(address);
      setContract(ratPad);
    } catch (err) {
      console.error("Wallet error:", err);
      alert("Connection failed.");
    }
  };

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const deployToken = async () => {
    const { name, symbol, supply, fee, lpLock } = form;
    if (!contract) return alert("Connect wallet first");
    if (!name || !symbol || !supply || !fee || !lpLock)
      return alert("Please fill all fields");
    if (parseInt(fee) > 5) return alert("Fee must be ‚â§ 5%");

    const ethValue = ethers.parseEther("0.05");
    try {
      setStatus("‚è≥ Launching MemeCoin with Liquidity...");
      const tx = await contract.launchWithLiquidity(
        name,
        symbol,
        BigInt(supply),
        BigInt(supply),
        0,
        0,
        Math.floor(Date.now() / 1000) + 600,
        parseInt(lpLock),
        parseInt(fee),
        { value: ethValue }
      );
      await tx.wait();
      setStatus("‚úÖ Token launched & LP locked!");
    } catch (err) {
      console.error("Launch error:", err);
      const msg = err?.info?.error?.message || err?.message || "Transaction failed.";
      setStatus("‚ùå " + msg);
    }
  };

  return (
    <div className="min-h-screen bg-[#0044ff] text-white font-mono flex flex-col items-center justify-center p-4">
      <h1 className="text-3xl md:text-4xl font-extrabold mb-4 text-white tracking-wider">
        RICKYRAT LAUNCHPAD üßÄ
      </h1>

      {!account ? (
        <button
          onClick={connectWallet}
          className="bg-yellow-400 text-black px-8 py-3 rounded-full font-bold hover:bg-yellow-300 shadow-md"
        >
          ü¶ä Connect MetaMask
        </button>
      ) : (
        <div className="bg-white text-black rounded-xl p-6 w-full max-w-lg space-y-4 shadow-lg">
          <div className="text-sm text-right text-gray-500 mb-2">
            Connected: {account.slice(0, 6)}...{account.slice(-4)}
          </div>

          <input name="name" onChange={handleChange} placeholder="Token Name" className="p-2 border rounded w-full" />
          <input name="symbol" onChange={handleChange} placeholder="Symbol (e.g. RICKY)" className="p-2 border rounded w-full" />
          <input name="supply" onChange={handleChange} type="number" placeholder="Total Supply" className="p-2 border rounded w-full" />
          <input name="fee" onChange={handleChange} type="number" placeholder="Fee % (max 5)" className="p-2 border rounded w-full" />
          <select name="lpLock" onChange={handleChange} className="p-2 border rounded w-full">
            <option value="86400">Lock LP: 1 Day</option>
            <option value="604800" selected>Lock LP: 1 Week</option>
            <option value="2592000">Lock LP: 1 Month</option>
          </select>

          <button onClick={deployToken} className="bg-green-600 text-white font-bold px-6 py-2 rounded hover:bg-green-700 mt-2">
            üöÄ Launch MemeCoin
          </button>

          {status && (
            <p className="text-center mt-2 text-sm text-gray-800 whitespace-pre-line">{status}</p>
          )}
        </div>
      )}
    </div>
  );
}
